,p_static_id=>'MONTHLY_REVIEW_'
,p_include_session_state=>'N'
,p_format=>'PDF'
,p_output_file_name=>'Monthly_Review '
,p_content_disposition=>'ATTACHMENT'
);
wwv_flow_imp_shared.create_shared_query_stmnt(
 p_id=>wwv_flow_imp.id(20149817353950438244)
,p_shared_query_id=>wwv_flow_imp.id(20149817062115438238)
,p_name=>'Monthly_Review'
,p_display_sequence=>1
,p_data_loop_name=>'monthly_review'
,p_location=>'LOCAL'
,p_query_type=>'SQL'
,p_sql_statement=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select o.order_id, to_char(o.order_timestamp,''Month yyyy'') order_month, o.order_timestamp order_date,',
'           c.cust_last_name || '', '' || c.cust_first_name customer_name, ',
'           c.cust_state,',
'           o.user_name sales_rep, ',
'           (select count(*) from demo_order_items  oi ',
'             where oi.order_id = o.order_id) order_items,',
'           o.order_total  ',
'from demo_orders o, demo_customers c ',
'where o.customer_id = c.customer_id'))
);
end;
