);
wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(20130558178425219681)
,p_plug_name=>'Product Order Tree'
,p_region_template_options=>'#DEFAULT#:t-Region--scrollBody'
,p_plug_template=>4072358936313175081
,p_plug_display_sequence=>10
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'with data as ( ',
'select ''R'' as link_type, null as parent, ''All Categories'' as id, ''All Categories'' as name, null as sub_id  from demo_product_info',
'union',
'select distinct(''C'') as link_type, ''All Categories'' as parent, category as id, category as name, null as sub_id  from demo_product_info',
'union',
'select ''P'' as link_type, category parent, to_char(product_id) id, product_name as name, product_id as sub_id from demo_product_info',
'union',
'select ''O'' as link_type, to_char(product_id) as parent, null as id, (select c.cust_first_name || '' '' || c.cust_last_name from demo_customers c,  demo_orders o where c.customer_id = o.customer_id and o.order_id = oi.order_id ) || '',  ordered ''|| to_ch'
||'ar(oi.quantity) as name, order_id as sub_id ',
'from demo_order_items oi',
')',
'select case ',
'       when connect_by_isleaf = 1 then 0',
'       when level = 1 then 1',
'       else -1',
'       end as status, level, name as title, null as icon, id as value, ''View'' as tooltip, ',
'       case ',
'       when link_type = ''R''',
'            then apex_util.prepare_url(''f?p=''||:APP_ID||'':3:''||:APP_SESSION||''::NO:RIR'')',
'       when link_type = ''C''',
'            then apex_util.prepare_url(''f?p=''||:APP_ID||'':3:''||:APP_SESSION||''::NO:CIR:IR_CATEGORY:'' || name)',
'       when link_type = ''P''',
'            then apex_util.prepare_url(''f?p=''||:APP_ID||'':6:''||:APP_SESSION||''::NO::P6_PRODUCT_ID:'' || sub_id)',
'       when link_type = ''O''',
'            then apex_util.prepare_url(''f?p=''||:APP_ID||'':29:''||:APP_SESSION||''::NO::P29_ORDER_ID:'' || sub_id)',
'       else null',
'       end as link ',
'from data',
'start with parent is null',
'connect by prior id = parent',
'order siblings by name'))
,p_lazy_loading=>false
,p_plug_source_type=>'NATIVE_JSTREE'
,p_plug_query_no_data_found=>'No data found.'
